import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Dashboard from "./Components/Dashboard";

const App = () => {
  return (
    <BrowserRouter>
      <Route path="/" component={Dashboard} />
    </BrowserRouter>
  );
};

export default App;
